import React, { Component } from 'react';
import { Link } from 'react-router-dom';


class Home extends Component {

  getUser(userId) {
    console.log(userId)
  }

  render() {
    return (
    <div className="App">

      <div className="LivBan">
        <header>Project Home</header>
      </div>

      {/* Link to List.js */}
      <Link to={'./list'}>
        <button variant="raised">
            My List
        </button>

      </Link>
      <div>
          {
            [1, 2, 3, 4, 5].map(value => {
              return (
                <div key={value}>
                  <button onClick={() => this.getUser(value)}>{value}</button>
                </div>
              )
            })
          }
        </div>
    </div>
    );
  }
}
export default Home;
